package com.vsk.rahul.sprint9;

import java.io.BufferedReader;
import java.io.FileNotFoundException;
import java.io.FileReader;
import java.io.IOException;
import java.util.Objects;

import org.testng.Assert;
import org.testng.annotations.Test;

/**
 * Unit test for simple App.
 */
public class WeightedUniformStringsTest {
    
	@Test(enabled = false)
	public void check() {
		String s = "";
		
		WeightedUniformStrings.setArray(s);
		BufferedReader br_in = null;
		BufferedReader br_out = null;
		try {
			br_in = new BufferedReader(new FileReader("TestCase14_Input.txt"));
			br_out = new BufferedReader(new FileReader("TestCase14_Output.txt"));
		    String input = null;
		    String output = null;
		    while ((input = br_in.readLine()) != null && (output = br_out.readLine()) != null) {
		       Assert.assertEquals(WeightedUniformStrings.validate(parseInt(input)), output);
		    }
		} catch(FileNotFoundException e) {
			
		} catch(IOException e) {
			
		} finally{
			try {
				if(!Objects.isNull(br_in)) br_in.close();
				if(!Objects.isNull(br_out)) br_out.close();
			}catch(IOException e) {
				// do nothing
			}
		}
	}
	
	int parseInt(String s) {
		try {
			return Integer.parseInt(s);
		} catch(NumberFormatException e) {
			return 0;
		}
	}
}